from backend import *
from backend import be_np as np, be_scp as scipy
from fir_separate import fir_separate
from filter_utils import filter_utils


def run_sim(params):
    print("Run parameters:")
    for attr in dir(params):
        if not callable(getattr(params, attr)) and not attr.startswith("__"):
            print(f"{attr} = {getattr(params, attr)}")
    print('\n')

    fir_separate_ins = fir_separate(params)
    if params.use_gpu and import_cupy:
        fir_separate_ins.check_gpu_usage()
        fir_separate_ins.print_gpu_memory()
        fir_separate_ins.warm_up_gpu()
        # fir_separate_ins.gpu_cpu_compare()
    fir_separate_ins.visulalize_filter_chars()

    print_thr=0
    time_print_thr=5

    err_rate = {}
    for fil_order in params.fil_orders:
        err_rate[fil_order] = {}
        for snr in params.snrs:
            err_rate[fil_order][snr] = {}
            for N_sig in params.N_sigs:
                err_rate[fil_order][snr][N_sig] = {}
                for N_r in params.N_rs:
                    err_rate[fil_order][snr][N_sig][N_r] = {}
                    fir_separate_ins.print("Starting simulation for filter order: {}, SNR: {:0.3f}, N_sig: {}, N_r:{}" \
                          .format(fil_order, snr, N_sig, N_r),print_thr)

                    params.base_order_pos = fil_order
                    params.snr = snr
                    params.N_sig = N_sig
                    params.N_r = N_r
                    fir_separate_ins = fir_separate(params)

                    wiener_err_list = []
                    basis_err_list = []
                    for i in range(params.n_iters):
                        fir_separate_ins.print("Iteration: {}".format(i + 1),print_thr)
                        times=[]

                        start = time.time()
                        (sig_bw, sig_psd, sig_cf, spatial_sig, aoa) = fir_separate_ins.gen_rand_params()
                        times.append(time.time()-start)
                        fir_separate_ins.print("gen_rand_params time: {0:5f}".format(times[-1]),time_print_thr)
                        start = time.time()
                        (rx, sigs) = fir_separate_ins.generate_signals(sig_bw=sig_bw, sig_psd=sig_psd,
                                                                       sig_cf=sig_cf, spatial_sig=spatial_sig)
                        times.append(time.time()-start)
                        fir_separate_ins.print("generate_signals time: {0:5f}".format(times[-1]),time_print_thr)
                        start = time.time()
                        fir_separate_ins.wiener_filter_design(rx=rx, sigs=sigs)
                        times.append(time.time()-start)
                        fir_separate_ins.print("wiener_filter_design time: {0:5f}".format(times[-1]),time_print_thr)
                        start = time.time()
                        fir_separate_ins.basis_filter_design(rx=rx, sigs=sigs, sig_bw=sig_bw, sig_cf=sig_cf)
                        times.append(time.time()-start)
                        fir_separate_ins.print("basis_filter_design time: {0:5f}".format(times[-1]),time_print_thr)
                        # fir_separate_ins.wiener_filter_apply(rx=rx, sigs=sigs)
                        # fir_separate_ins.basis_filter_apply(rx=rx, sigs=sigs, mode='test')
                        # fir_separate_ins.print("Wiener filter error: {0:5f}".format(np.mean(fir_separate_ins.wiener_errs)), print_thr)
                        # fir_separate_ins.print("Basis filter error: {0:5f}".format(np.mean(fir_separate_ins.basis_errs)), print_thr)

                        start = time.time()
                        (rx, sigs) = fir_separate_ins.generate_signals(sig_bw=sig_bw, sig_psd=sig_psd,
                                                                       sig_cf=sig_cf, spatial_sig=spatial_sig)
                        times.append(time.time()-start)
                        fir_separate_ins.print("generate_signals time: {0:5f}".format(times[-1]),time_print_thr)
                        start = time.time()
                        fir_separate_ins.wiener_filter_apply(rx=rx, sigs=sigs)
                        times.append(time.time()-start)
                        fir_separate_ins.print("wiener_filter_apply time: {0:5f}".format(times[-1]),time_print_thr)
                        start = time.time()
                        fir_separate_ins.basis_filter_apply(rx=rx, sigs=sigs, mode='test')
                        times.append(time.time()-start)
                        fir_separate_ins.print("basis_filter_apply time: {0:5f}".format(times[-1]),time_print_thr)

                        start = time.time()
                        # fir_separate_ins.wiener_filter_param(sig_bw=sig_bw, sig_psd=sig_psd, sig_cf=sig_cf, spatial_sig=spatial_sig)
                        # fir_separate_ins.basis_filter_param(sig_bw=sig_bw, sig_psd=sig_psd, sig_cf=sig_cf, spatial_sig=spatial_sig)
                        times.append(time.time()-start)
                        fir_separate_ins.print("wiener_filter_param and basis_filter_param time: {0:5f}".format(times[-1]),time_print_thr)

                        wiener_err_list.append(np.mean(fir_separate_ins.wiener_errs))
                        basis_err_list.append(np.mean(fir_separate_ins.basis_errs))
                        fir_separate_ins.print("Wiener filter error: {0:5f}".format(wiener_err_list[-1]),print_thr)
                        fir_separate_ins.print("Basis filter error: {0:5f}".format(basis_err_list[-1]),print_thr)
                        fir_separate_ins.print("Execution time: {0:5f}".format(np.sum(np.array(times))), time_print_thr)


                    err_rate[fil_order][snr][N_sig][N_r]['wiener'] = np.mean(np.array(wiener_err_list))
                    err_rate[fil_order][snr][N_sig][N_r]['basis'] = np.mean(np.array(basis_err_list))
                    fir_separate_ins.print("\nMean wiener filter error: {0:5f}".format(np.mean(np.array(wiener_err_list))),print_thr)
                    fir_separate_ins.print("Mean basis filter error: {0:5f}\n".format(np.mean(np.array(basis_err_list))),print_thr)

        fir_separate_ins.print("error rate dictionary: {}\n".format(err_rate),print_thr)

    fir_separate_ins.print("error rate dictionary: {}".format(err_rate),print_thr)

    fir_separate_ins.visualize_sweeps(plot_dic=err_rate)
    plt.show()


def plot_wiener_heatmap(params):
    print_thr = 0
    params.N_sig = 4
    params.N_r = 8
    params.ant_dim = 1
    params.base_order_pos = 64
    params.snr_db = 20
    aoa_num = 32
    sig_id = 0
    psd_f_db = -6
    el_f = 0
    bw_f = params.fs/aoa_num
    spat_sig_mag_f = 1.0

    aoas = np.linspace(-np.pi, np.pi - 2*np.pi / aoa_num, aoa_num)
    sig_cfs = np.linspace((-1*params.fs/2)+bw_f, params.fs/2-bw_f, aoa_num)

    fir_separate_ins = fir_separate(params)

    S = np.zeros((len(aoas), params.n_samples))
    for i in range(len(aoas)):
        fir_separate_ins.print('Starting experiment for AoA: {:0.3f} Rad'.format(aoas[i]), print_thr)

        params.psd_range_db = [psd_f_db, psd_f_db]
        params.psd_range = fir_separate.db_to_lin(None, np.array(params.psd_range_db))
        params.az_range = [aoas[i], aoas[i]]
        params.el_range = [el_f, el_f]
        params.bw_range = [bw_f, bw_f]
        params.cf_range = [sig_cfs[i], sig_cfs[i]]
        params.spat_sig_range = [spat_sig_mag_f, spat_sig_mag_f]

        fir_separate_ins = fir_separate(params)

        (sig_bw, sig_psd, sig_cf, spatial_sig, aoa) = fir_separate_ins.gen_rand_params()
        (rx, sigs) = fir_separate_ins.generate_signals(sig_bw=sig_bw, sig_psd=sig_psd,
                                                       sig_cf=sig_cf, spatial_sig=spatial_sig)
        fir_separate_ins.wiener_filter_design(rx=rx, sigs=sigs)

        # print('bw: ', fir_separate_ins.sig_bw / 1e6)
        # print('cf: ', fir_separate_ins.sig_cf / 1e6)
        # print('psd: ', fir_separate_ins.sig_psd)
        # print('spat_sig: ', np.mean(np.abs(fir_separate_ins.spatial_sig)))
        # print('aoa: ', fir_separate_ins.aoa)
        f_len = len(fir_separate_ins.freq)
        h_simo = np.zeros((params.N_r, f_len), dtype=complex)
        for rx_id in range(params.N_r):
            w, h = freqz(fir_separate_ins.fil_wiener_single[sig_id][rx_id], worN=fir_separate_ins.om)
            h_simo[rx_id, :] = h
            # print(np.mean(np.abs(h_simo)))
            # print(np.mean(np.abs(self.spatial_sig[:,sig_id])))
        S[i, :] = np.abs(np.dot(np.conj(fir_separate_ins.spatial_sig[:, sig_id].T), h_simo)) ** 2
            # print(np.mean(np.abs(S[sig_id,:])))
        # print(np.mean(np.abs(S), axis=1))
        # print(np.abs(S))

    S = fir_separate_ins.lin_to_db(S)
    plt.figure(figsize=(10, 6))
    plt.imshow(S, aspect='auto',
               extent=[fir_separate_ins.freq[0] / 1e6, fir_separate_ins.freq[-1] / 1e6, -np.pi, np.pi],
               cmap='viridis', interpolation='nearest')
    plt.colorbar(label=r'Gain $|S(\theta,f)|^2$')
    plt.xlabel('Frequency (MHz)')
    plt.ylabel('Angle of Arrival (Rad)')
    plt.title('Wiener Filter Response Heatmap')
    plt.show()





